DROP DATABASE IF EXISTS TALLER_01;

CREATE DATABASE IF NOT EXISTS TALLER_01;

USE TALLER_01;

CREATE TABLE IF NOT EXISTS HOSPITAL
(
	ID INT NOT NULL UNIQUE DEFAULT 1,
    nombre VARCHAR (50) NOT NULL,
    ubicacion VARCHAR (50) NOT NULL,
	PRIMARY KEY(ID)
);


CREATE TABLE IF NOT EXISTS RECURSOS
(
	ID INT NOT NULL,
    ID_HOSPITAL INT NOT NULL DEFAULT 1,
    nombre VARCHAR(500) NOT NULL,
    cantidad INT NOT NULL,
    PRIMARY KEY(ID, ID_HOSPITAL),
    FOREIGN KEY(ID_HOSPITAL) REFERENCES HOSPITAL(ID)
);



CREATE TABLE IF NOT EXISTS AMBULANCIA
(
	PATENTE VARCHAR(6) NOT NULL,
    ID_HOSPITAL INT NOT NULL,
	estado VARCHAR (50) NOT NULL,
    last_update TIMESTAMP DEFAULT NOW(),
    PRIMARY KEY(PATENTE),
    FOREIGN KEY(ID_HOSPITAL) REFERENCES HOSPITAL(ID)
);

CREATE TABLE IF NOT EXISTS PARAMEDICO
(
	DNI INT NOT NULL UNIQUE,
    PATENTE_AMBULANCIA VARCHAR(6) NOT NULL,
    nombre VARCHAR(50) NOT NULL,
    apellido_p VARCHAR (50),
    apellido_m VARCHAR (50),
	PRIMARY KEY(DNI),
    FOREIGN KEY(PATENTE_AMBULANCIA) REFERENCES AMBULANCIA(PATENTE)
);

CREATE TABLE IF NOT EXISTS IMPLEMENTOS_AMBULANCIA
(
	ID INT NOT NULL,
    PATENTE_AMBULANCIA VARCHAR(6) NOT NULL,
    nombre VARCHAR(500),
	cantidad INT NOT NULL,
    last_update TIMESTAMP DEFAULT NOW(),
    PRIMARY KEY(ID, PATENTE_AMBULANCIA),
    FOREIGN KEY(PATENTE_AMBULANCIA) REFERENCES AMBULANCIA(PATENTE)
);

CREATE TABLE IF NOT EXISTS DOCTOR
(
	DNI INT NOT NULL AUTO_INCREMENT,
    ID_HOSPITAL INT NOT NULL DEFAULT 1,
    nombre VARCHAR(20),
    apellido_p VARCHAR(50),
    apellido_m VARCHAR(50),
    especialidad VARCHAR(50),
	PRIMARY KEY (DNI),
    FOREIGN KEY (ID_HOSPITAL) REFERENCES HOSPITAL(ID)
);

CREATE TABLE IF NOT EXISTS BOX
(
	NUMERO INT NOT NULL,
    DNI_DOCTOR INT NOT NULL,
    estado VARCHAR(50),
    PRIMARY KEY (NUMERO),
    FOREIGN KEY (DNI_DOCTOR) REFERENCES DOCTOR(DNI)
);

CREATE TABLE IF NOT EXISTS IMPLEMENTOS_BOX
(
	ID INT NOT NULL,
    NUMERO_BOX INT NOT NULL,
    nombre VARCHAR(500),
    CANTIDAD INT DEFAULT 0,
    last_update TIMESTAMP DEFAULT NOW(),
    PRIMARY KEY (ID, NUMERO_BOX),
    FOREIGN KEY (NUMERO_BOX) REFERENCES BOX(NUMERO)
);


CREATE TABLE IF NOT EXISTS PACIENTE
(
	DNI INT NOT NULL AUTO_INCREMENT,
    nombre VARCHAR(30),
    apellido_p VARCHAR(30),
    apellido_m VARCHAR(30),
    PRIMARY KEY (DNI)
);

CREATE TABLE IF NOT EXISTS RELACION_DOCTOR_PACIENTE
(
	ID_ATENCION INT NOT NULL AUTO_INCREMENT,
    DNI_DOCTOR INT NOT NULL,
    DNI_PACIENTE INT NOT NULL,
    DETALLE_DIAGNOSTICO VARCHAR(700) NOT NULL DEFAULT " ",
    TRATAMIENTO VARCHAR(2000) NOT NULL DEFAULT " ",
    INDEX (DETALLE_DIAGNOSTICO),
    FOREIGN KEY (DNI_DOCTOR) REFERENCES DOCTOR(DNI) ON DELETE CASCADE,
	FOREIGN KEY (DNI_PACIENTE) REFERENCES PACIENTE(DNI) ON DELETE CASCADE,
    PRIMARY KEY (ID_ATENCION,DNI_DOCTOR, DNI_PACIENTE)
);


CREATE TABLE IF NOT EXISTS FICHA_MEDICA
(
	DNI INT NOT NULL AUTO_INCREMENT,
    DNI_PACIENTE INT NOT NULL,
    DETALLE_DIAGNOSTICO VARCHAR(700) DEFAULT " ",
    TRATAMIENTO VARCHAR(2000) DEFAULT " ",
    PRIMARY KEY (DNI),
    FOREIGN KEY (DNI_PACIENTE) REFERENCES PACIENTE(DNI) ON DELETE CASCADE
);

#TRIGGER

DROP TRIGGER IF EXISTS ACTUALIZAR_INVENTARIO;
DELIMITER //
CREATE TRIGGER ACTUALIZAR_INVENTARIO AFTER INSERT ON IMPLEMENTOS_BOX FOR EACH ROW 
	BEGIN
		#REVISAR SI EL IMPLEMENTO YA EXISTE
		DECLARE EXISTE_IMPLEMENTO INT DEFAULT 0; 
        DECLARE CANTIDAD_ANTES INT DEFAULT 0;
		SELECT COUNT(ID) INTO EXISTE_IMPLEMENTO FROM RECURSOS WHERE RECURSOS.ID = NEW.ID;
        SELECT CANTIDAD INTO CANTIDAD_ANTES FROM RECURSOS WHERE RECURSOS.ID = NEW.ID;
        IF EXISTE_IMPLEMENTO != 0 THEN UPDATE RECURSOS SET CANTIDAD = CANTIDAD_ANTES + NEW.CANTIDAD WHERE RECURSOS.ID = NEW.ID;
        ELSE INSERT INTO RECURSOS (ID, NOMBRE, CANTIDAD) VALUES (NEW.ID, NEW.NOMBRE, NEW.CANTIDAD);
        END IF;
    END;
    //
DELIMITER ;

DROP TRIGGER IF EXISTS ACTUALIZAR_INVENTARIO2;
DELIMITER //
CREATE TRIGGER ACTUALIZAR_INVENTARIO2 AFTER UPDATE ON IMPLEMENTOS_BOX FOR EACH ROW 
	BEGIN
		#REVISAR SI EL IMPLEMENTO YA EXISTE
		DECLARE CANTIDAD_ANTES INT DEFAULT 0;
        DECLARE FLAG BOOLEAN DEFAULT FALSE;
        SELECT CANTIDAD INTO CANTIDAD_ANTES FROM RECURSOS WHERE RECURSOS.ID = NEW.ID;
		UPDATE RECURSOS SET CANTIDAD = CANTIDAD_ANTES + NEW.CANTIDAD - OLD.CANTIDAD WHERE RECURSOS.ID = NEW.ID;
	END;
    //
DELIMITER ;

DROP TRIGGER IF EXISTS ACTUALIZAR_INVENTARIO3;
DELIMITER //
CREATE TRIGGER ACTUALIZAR_INVENTARIO3 AFTER INSERT ON IMPLEMENTOS_AMBULANCIA FOR EACH ROW
	BEGIN
		#REVISAR SI EL IMPLEMENTO YA EXISTE
		DECLARE EXISTE_IMPLEMENTO INT DEFAULT 0;
        DECLARE CANTIDAD_ANTES INT DEFAULT 0;
		SELECT COUNT(ID) INTO EXISTE_IMPLEMENTO FROM RECURSOS WHERE RECURSOS.ID = NEW.ID;
        SELECT CANTIDAD INTO CANTIDAD_ANTES FROM RECURSOS WHERE RECURSOS.ID = NEW.ID;
        IF EXISTE_IMPLEMENTO != 0 THEN UPDATE RECURSOS SET CANTIDAD = CANTIDAD_ANTES + NEW.CANTIDAD WHERE RECURSOS.ID = NEW.ID;
        ELSE INSERT INTO RECURSOS (ID, NOMBRE, CANTIDAD) VALUES (NEW.ID, NEW.NOMBRE, NEW.CANTIDAD);
        END IF;
    END;
    //
DELIMITER ;

DROP TRIGGER IF EXISTS ACTUALIZAR_INVENTARIO4;
DELIMITER //
CREATE TRIGGER ACTUALIZAR_INVENTARIO4 AFTER UPDATE ON IMPLEMENTOS_AMBULANCIA FOR EACH ROW 
	BEGIN
		#REVISAR SI EL IMPLEMENTO YA EXISTE
		DECLARE CANTIDAD_ANTES INT DEFAULT 0;
		SELECT CANTIDAD INTO CANTIDAD_ANTES FROM RECURSOS WHERE RECURSOS.ID = NEW.ID;
		UPDATE RECURSOS SET CANTIDAD = CANTIDAD_ANTES + NEW.CANTIDAD - OLD.CANTIDAD WHERE RECURSOS.ID = NEW.ID;
		END;
    //
DELIMITER ;


DROP TRIGGER IF EXISTS ACTUALIZAR_FICHA_MEDICA;
DELIMITER //
CREATE TRIGGER ACTUALIZAR_FICHA_MEDICA AFTER UPDATE ON RELACION_DOCTOR_PACIENTE FOR EACH ROW
	BEGIN
        INSERT INTO FICHA_MEDICA (DNI_PACIENTE, DETALLE_DIAGNOSTICO, TRATAMIENTO) VALUES (NEW.DNI_PACIENTE, NEW.DETALLE_DIAGNOSTICO, NEW.TRATAMIENTO);
        END;
	//
DELIMITER ;


