DROP FUNCTION IF EXISTS EXISTE_PACIENTE;
DELIMITER //
CREATE FUNCTION EXISTE_PACIENTE (ID_PACIENTE INT) RETURNS INT DETERMINISTIC
	BEGIN
		DECLARE EXISTE_PACIENTE INT;
		SELECT COUNT(DNI) INTO EXISTE_PACIENTE FROM PACIENTE WHERE PACIENTE.DNI = ID_PACIENTE;
        IF EXISTE_PACIENTE = 0 THEN RETURN 0;
        ELSE RETURN 1;
        END IF;
	END//
DELIMITER ;




