DROP PROCEDURE IF EXISTS DIAGNOSTICAR_PACIENTE;
DELIMITER //
CREATE PROCEDURE DIAGNOSTICAR_PACIENTE(IN ID_ATENCION INT, IN DETALLE VARCHAR(2000), IN TRATAMIENTO VARCHAR(2000))
	BEGIN		
		DECLARE EXISTE_ATENCION INT DEFAULT 0;  
        SELECT COUNT(ID_ATENCION) INTO EXISTE_ATENCION FROM RELACION_DOCTOR_PACIENTE WHERE RELACION_DOCTOR_PACIENTE.ID_ATENCION = ID_ATENCION;
    
		#SI TODO ESTA BIEN SE INSERTA EL DIAGNOSTICO
        IF EXISTE_ATENCION = 1 THEN
        UPDATE RELACION_DOCTOR_PACIENTE SET RELACION_DOCTOR_PACIENTE.DETALLE_DIAGNOSTICO = DETALLE WHERE RELACION_DOCTOR_PACIENTE.ID_ATENCION = ID_ATENCION;
        UPDATE RELACION_DOCTOR_PACIENTE SET RELACION_DOCTOR_PACIENTE.TRATAMIENTO = TRATAMIENTO WHERE RELACION_DOCTOR_PACIENTE.ID_ATENCION = ID_ATENCION;
        ELSE SELECT "DOCTOR O PACIENTE INCORRECTO";
        END IF;    
	END//
DELIMITER ;


