#(SELECT CANTIDAD FROM RECURSOS WHERE RECURSOS.ID = NEW.ID) + NEW.CANTIDAD WHERE RECURSOS.ID = NEW.ID

#consulta 1 DASHBOARD
CREATE VIEW DOCTORES_CON_MAS_DE_UN_DIAGNOSTICO AS SELECT DOCTOR.DNI AS DNI_DOCTOR, DOCTOR.NOMBRE AS NOMBRE_DOCTOR, DOCTOR.APELLIDO_P AS APELLIDO_DOCTOR, COUNT(PACIENTE.DNI) FROM DOCTOR
		INNER JOIN RELACION_DOCTOR_PACIENTE ON DOCTOR.DNI = RELACION_DOCTOR_PACIENTE.DNI_DOCTOR
		INNER JOIN PACIENTE ON RELACION_DOCTOR_PACIENTE.DNI_PACIENTE = PACIENTE.DNI  WHERE RELACION_DOCTOR_PACIENTE.DETALLE_DIAGNOSTICO != " " GROUP BY DOCTOR.DNI HAVING COUNT(PACIENTE.DNI) > 1 ;
SELECT * FROM DOCTORES_CON_MAS_DE_UN_DIAGNOSTICO;


#consulta 2 DASHBOARD
CREATE VIEW DIAGNOSTICOS AS SELECT DOCTOR.DNI AS DNI_DOCTOR, DOCTOR.NOMBRE AS NOMBRE_DOCTOR, DOCTOR.APELLIDO_P AS APELLIDO_DOCTOR, PACIENTE.DNI AS DNI_PACIENTE, PACIENTE.NOMBRE AS NOMBRE_PACIENTE, PACIENTE.APELLIDO_P AS APELLIDO_PACIENTE, DETALLE_DIAGNOSTICO, TRATAMIENTO FROM DOCTOR
	INNER JOIN RELACION_DOCTOR_PACIENTE ON DOCTOR.DNI = RELACION_DOCTOR_PACIENTE.DNI_DOCTOR
    INNER JOIN PACIENTE ON RELACION_DOCTOR_PACIENTE.DNI_PACIENTE = PACIENTE.DNI  WHERE RELACION_DOCTOR_PACIENTE.DETALLE_DIAGNOSTICO != " " ORDER BY DOCTOR.DNI;
SELECT * FROM DIAGNOSTICOS;

#CONSULTA 3 DASHBOARD INVENTARIO
CREATE VIEW INVENTARIO AS SELECT ID, NOMBRE, CANTIDAD FROM RECURSOS;
SELECT * FROM INVENTARIO;



